    data: |
      SELECT DISTINCT + cor0.col2 / 20 + + col0 * col0 - - ( - col0 ) * col2 FROM tab0 (FORMAT parquet) AS cor0;
  - name: tab0

outputs:
  - name: q6641.out
    data: |
      -215
      1190
      627
